void  time_display(bool *time_flag)
{
      
				unsigned char date_buf[24];
				static unsigned char time_old = 0;
	      // 
					// Clear the RTC Alarm Flag 
		    RTC_ClearFlag(RTC_FLAG_ALRAF);	
 			  RTC_GetTime(RTC_Format_BIN, &RTC_TimeStructure);
				(void)RTC->DR;
				
				if(time_old != RTC_TimeStructure.RTC_Seconds)
				{
					   RTC_GetDate(RTC_Format_BIN, &RTC_DateStructure);
						 sprintf(date_buf,"20%0.2d/%0.2d/%0.2d  %0.2d:%0.2d:%0.2d", RTC_DateStructure.RTC_Year,RTC_DateStructure.RTC_Month, RTC_DateStructure.RTC_Date,RTC_TimeStructure.RTC_Hours, RTC_TimeStructure.RTC_Minutes,RTC_TimeStructure.RTC_Seconds);
						 GUI_SetFont(&GUI_Font24_ASCII);		   //&GUI_Font24B_1
						 GUI_SetBkColor(0x85A100);
						 GUI_SetColor(GUI_WHITE);
						 GUI_DispStringAt(date_buf,590,9);
						 time_old = RTC_TimeStructure.RTC_Seconds;
				}
				
							
			
			
}

