void Page_to_Block(unsigned long Page_length,NAND_ADDRESS *Address)
{
			Address->Zone = (Page_length-1  ) / (1024)/32;
			Address->Block = ((Page_length-1)   - Address->Zone* 1024*32)/32;
			Address->Page = (Page_length-1)%32;
}
